import React from "react";
import axios from "axios";
import "./styles.css";

export default class App extends React.Component {
  state = {
    users: [],
  };
  componentDidMount() {
    axios.get("/users.json").then((response) => {
      this.setState({ users: response.data });
    });
  }

  render() {
    const { users } = this.state;
    const crap = (
        <div>
          <ul className="users">
            {users.map((user) => (
              <li className="user">
                <p>
                  <strong>Name:</strong> {user.name}
                </p>
                <p>
                  <strong>Email:</strong> {user.email}
                </p>
                <p>
                  <strong>City:</strong> {user.address.city}
                </p>
              </li>
            ))}
          </ul>
        </div>
      );
    return (
        <div className="container">
            <div className="jumbotron">
                <h1>MTG Custom Card Creator</h1>
            </div>
            <div className="row justify-content-center">
                <div className="col-sm-6 text-right">
                    <h2>New User? Register below</h2><br/>
                    <form>
                        <label for="emailaddress">Email Address</label>
                        <input type="email" className="signUpFields" id="emailaddress" name="emailaddress"/><br/>
                        <label for="username">Username</label>
                        <input type="text" className="signUpFields" id="username" name="username"/><br/>
                        <label for="password">Password</label>
                        <input type="password" className="signUpFields" id="password" name="password"/><br/>
                        <p class='info'>8 or more characters, at least 1 capital, lowercase, and number</p>
                        <label for="confirmpassword">Confirm Password</label>
                        <input type="password" class="signUpFields" id="confirmpassword" name="confirmpassword"/><br/>
                        <input type="checkbox" class="signUpFields" id="newsletter" name="newsletter" checked/><label for="newsletter">Newsletter</label><br/>
                        <button type="button" class="btn btn-lg btn-primary" id="signup" disabled>Signup</button>
                    </form>
                </div>
                <div className="col-sm-6 text-right">
                    <h2>Returning user? Sign in below</h2><br/>
                    <form>
                        <label for="usernamelogin">Username</label>
                        <input type="text" className="loginFields" id="usernamelogin" name="usernamelogin"/><br/>
                        <label for="passwordlogin">Password</label>
                        <input type="password" className="loginFields" id="passwordlogin" name="passwordlogin"/><br/><br/>
                        <button type="button" className="btn btn-lg btn-primary" id="login" disabled>Sign In</button><br/><br/>
                    </form>
                    <a role="button" aria-pressed="true" className="btn btn-lg btn-primary" href="https://github.com/login/oauth/authorize?client_id=bb174328d123ef3f1aa0&scope=gist">Sign In using Github</a><br/>
                    <form>

                    </form>

                </div>
            </div>
        </div>
    )
  }
}
